import React, { useEffect, useState } from "react";
import { useSearchParams } from "react-router-dom";
import "./testsolver.css";

function Testsolver() {
  const [searchParams] = useSearchParams();
  const [test, setTest] = useState();
  const [answers, setAnswers] = useState([]);
  const [result, setResult] = useState([]);
  const [score, setScore] = useState(0);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch(
          "http://localhost:8000/tests/" + searchParams.get("id")
        );
        if (!response.ok) {
          console.error("Error fetching data");
        } else {
          const data = await response.json();
          setTest(data);
          setAnswers(Array(data.QUESTIONS.length).fill([]));
        }
      } catch (error) {
        console.error(error);
      }
    };

    fetchData();
  }, []);

  const handleAnswerChange = (questionIndex, answerIndex) => {
    setAnswers((prevAnswers) => {
      const updatedAnswers = [...prevAnswers];
      updatedAnswers[questionIndex] = answerIndex;
      return updatedAnswers;
    });
  };

  const handleSubmit = () => {
    const resultArray = test.QUESTIONS.map((question, questionIndex) => {
      const selectedAnswers = answers[questionIndex];
      const correctAnswers = question.RIGHTANSWER;
      const isCorrect = JSON.stringify(selectedAnswers) === JSON.stringify(correctAnswers);
      const questionScore = parseInt(question.SCORE);
      return {
        isCorrect,
        score: isCorrect ? questionScore : 0,
      };
    });

    const totalScore = resultArray.reduce((sum, question) => sum + question.score, 0);
    setResult(resultArray);
    setScore(totalScore);
  };

  if (!test) {
    return <>Loading....</>;
  }

  return (
    <div className="container">
      <h2>{test.TESTNAME}</h2>
      <p>Class: {test.CLASS}</p>
      <h3>Questions:</h3>

      {test.QUESTIONS.map((question, questionIndex) => (
        <div key={questionIndex} className="question">
          <p>
            {questionIndex + 1}. {question.QUESTION}
          </p>
          {question.TYPE === "singleAnswered" && (
            <ul className="answers">
              {question.ANSWERS.map((answer, answerIndex) => (
                <li
                  key={answerIndex}
                  className="answer"
                  onClick={() => handleAnswerChange(questionIndex, answerIndex)}
                >
                  <input
                    type="radio"
                    name={`question-${questionIndex}`}
                    id={`question-${questionIndex}-answer-${answerIndex}`}
                    checked={answers[questionIndex] === answerIndex}
                    onChange={() => {}}
                  />
                  <label htmlFor={`question-${questionIndex}-answer-${answerIndex}`}>
                    {answer}
                  </label>
                </li>
              ))}
            </ul>
          )}
          {question.TYPE === "multiAnswered" && (
            <ul className="answers">
              {question.ANSWERS.map((answer, answerIndex) => (
                <li
                  key={answerIndex}
                  className="answer"
                  onClick={() => handleMultiAnswerChange(questionIndex, answerIndex)}
                >
                  <input
                    type="checkbox"
                    name={`question-${questionIndex}`}
                    id={`question-${questionIndex}-answer-${answerIndex}`}
                    checked={answers[questionIndex].includes(answerIndex)}
                    onChange={() => {}}
                  />
                  <label htmlFor={`question-${questionIndex}-answer-${answerIndex}`}>
                    {answer}
                  </label>
                </li>
              ))}
            </ul>
          )}
        </div>
      ))}

      <button className="submit-button" onClick={handleSubmit}>
        Submit
      </button>

      {result.length > 0 && (
        <div className="result">
          <h3>Result:</h3>
          <ul>
            {result.map((questionResult, questionIndex) => (
              <li key={questionIndex}>
                Question {questionIndex + 1}:{" "}
                {questionResult.isCorrect ? "Correct" : "Incorrect"} (Score:{" "}
                {questionResult.score})
              </li>
            ))}
          </ul>
          <p>Total Score: {score}</p>
        </div>
      )}
    </div>
  );
}

export default Testsolver;
